/**
 * Constructor
 */
inline Cymbal::Cymbal(){
  this->player = new AudioPlayPitchedMemory();
  this->output = new AudioMixer4();
  this->output->gain(0, 0.15);

  this->patchCords[0] = new AudioConnection(*this->player, 0, *this->output, 0);
}

/**
 * Return the audio output
 */
inline AudioMixer4 * Cymbal::getOutput(){
  return this->output;
}

/**
 * Note on
 * 
 * @param crash Is it a crash
 */
inline void Cymbal::noteOn(bool crash) {
  if(crash){
    this->player->play(this->crashSample, 40640);
  }else{
    this->player->play(this->cymbalSample, 35520);
  }
}



/**
 * Set the pitch
 */
inline void Cymbal::setPitch(float pitch) {
  this->player->frequency(constrain(pitch, 0, 1023));
}

